import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';

export class Navbar extends Component {
    displayNavbar = () => {
        if (this.props.loggedIn) {
            return <>
                <button><NavLink to="/">Home</NavLink></button>
                <button><NavLink to="/profile">Profile</NavLink></button>
                <button><NavLink to="/post/new">New Post</NavLink></button>
                <button><NavLink to="/timeline">Timeline</NavLink></button>
                <button><NavLink to="/logout">Logout</NavLink></button>
            </>
        } else {
            return <>
                <button onClick={this.props.signUp}><NavLink to="/signup">Signup</NavLink></button>
                <button onClick={this.props.login}><NavLink to="/login">Login</NavLink></button>
            </>
        }
    }
    render() {
        return (
            <>
                {this.displayNavbar()}
            </>
        )
    }
}

export default Navbar
